var expect = require("expect.js");

var minSkew = require("../../main/js/minSkew");

describe("MinSkew Spec", function () {

    var genome;

    it("should process short text", function () {
        //given
        genome = "TAAAGACTGCCGAGAGGCCAACACGAGTGCTAGAACGAGGGGCGTAAACGCGGGTCCGAT";

        //when
        //then
        expect(minSkew(genome).join(" ")).to.be("11 24");
    });

    it("should process extra dataset", function () {
        //given
        genome = "";

        //when
        //then
        expect(minSkew(genome).join(" ")).to.be("89969 89970 89971 90345 90346");
    });

    it("should process data challenge", function () {
        //given
        genome = "";

        //when
        //then
        expect(minSkew(genome).join(" ")).to.be("6444 6445");
    });

});